			function getMaxFromArray(arr){
				var max = -1000000000;
				for (var key in arr) {
					if(max < arr[key]){
						max = arr[key]
					}
				}
				return max;

			function combine2Arrays(a, b){
				var res = {};
				for (i = 0; i < resultArr.length; i++) {
					var key = resultArr[i][0][2];
					res[key] =  1 - Math.sqrt(Math.sqrt(a[key])/(2 + b[key]));
				}
				return res;
			}

			function combine3Arrays(a, b, c){
				var res = {};
				for (i = 0; i < resultArr.length; i++) {
					var key = resultArr[i][0][2];
					if(a[key] && b[key] && c[key]){
						res[key] = 1 - Math.sqrt(Math.sqrt(Math.sqrt(a[key]))/((2 + c[key])*(2 + b[key])));
					}
				}
				return res;
			}

			function combine4Arrays(a, b, c, d){
				var res = {};
				for (i = 0; i < resultArr.length; i++) {
					var key = resultArr[i][0][2];
					res[key] = 1 - Math.sqrt(Math.sqrt(Math.sqrt(a[key]))/((2 + c[key])*(2 + b[key])));
				}
				return res;
			}

			function addArrays(a, b){
				var res = {};
				for (i = 0; i < resultArr.length; i++) {
					res[resultArr[i][0][2]] = a[resultArr[i][0][2]] + b[resultArr[i][0][2]];
				}

				}
				return res;

				var max = getMaxFromArray(arr);

				for (i = 0; i < resultArr.length; i++) {

				}
				return res;

			function parseSingleGraphs(d){
				var rA = [];
				var previousArrayIndex = 0;
				for (i = 0; i < d.length - 2; i++) {

					if(d[i][0] > d[i + 1][0]){
						rA[rA.length] = d.slice(previousArrayIndex, i);
						previousArrayIndex = i + 1;
					}
					if(rA.length > colorsX.length/2 - 1){
						return rA;
					}
				}
				rA[rA.length] = d.slice(previousArrayIndex, d.length - 1);
				return rA;
			}

			function drawPlotZ(resultArr, data){
				resultArr.sort(function (a, b) {
						var e_a = entropies[a[0][2]];
						var e_b = entropies[b[0][2]];
